import React  from 'react';
import Card from './Cardd';

const CardList = ({robots}) =>{
	return (
		<>
			{
				robots.map((user ,x) => {
					return (
							<Card key={x} n={robots[x].name} e={robots[x].email} i={robots[x].id} />
						);
					})
			}
		</>
	);
}
export default CardList;
